import React from 'react';
import {Card, Avatar} from 'antd';

const UserProfile = () => {
    return (
        <Card>
            <Card.Meta
                avatar={<Avatar>LR</Avatar>}
                title="LeaRomero"
            />
        </Card>
    );
}

export default UserProfile;
